import React  from 'react';
import Moment from 'react-moment';
 
export default class ProposalCount extends React.Component {
    render() {
        const date = new Date();
 
        return (
            <div>
                <Moment parse="YYYY-MM-DD HH:mm"  add={{ hours: 48 }}>{date}</Moment>
            </div>
        );
    }
}
